import React from 'react'
import axios from 'axios'
import { ListGroup, ListGroupItem } from "react-bootstrap";

class ListComponent extends React.Component {

  constructor(props) {
    super(props);

    this.state = {
      data: null
    };
  }
  
  componentWillMount() {
    this.test();
  }
  test() {
    axios.get('http://localhost:8000/getProduce').then(map((result) => {
      // console.log(result.data);
      return {posts: result.data.map(post => {
        return {
          title: post.name
        };
      })}
      this.setState({data: result.data});
      
    })
    )
  }
    render() {
      if (!this.state.data) {
        return <div />
      }

      return (
        <div>
        {this.state.data[0]}
        </div>
      );
    }
  }

  export default ListComponent;
